import Data from "../Assets/Data/data.json";
import PropTypes from "prop-types";

const headerData = Data.data[0].headerContent;

function Header({ text }) {
    return <header className="h-content">
        <picture>
            {
                headerData.map(content => {
                    <img className="img-fluid" src={content.srcPath} alt={content.alt} />
                })
            }
        </picture>
        <h5 className="text-center mb-5">{text}</h5>
    </header>
}

Header.propTypes = {
    text: PropTypes.string
}

export default Header;
